BR>ちょこんと座ったジジがかわいらしい、<BR>
魔女の宅急便【おくりもの】トイレタリーシリーズです。<BR><BR>

こちらは、洗浄暖房便座用です。<BR>
※普通便座用のご用意もございます。<BR><BR>
毛足は長めで、サラサラ＆フカフカ感！<BR>
素材はアクリル100％の吸水素材。<BR>
普通洗濯機でのお洗濯もOKです！<BR><BR>

刺しゅう＆アップリケで作られた黒ネコのジジたちが、<BR>
かわいらしいデザインです。<BR><BR>
魔女の宅急便【おくりもの】シリーズは、ほかにもお揃いの仲間がいます。<BR>
一式揃えられたら、ほんわかとしたかわいい雰囲気になりますよ。<BR>
<BR>

【素材】<BR>
本　体：アクリル　100％<BR><BR>
【タイプ】<BR>
洗浄暖房便座用<BR>
普通便座タイプにはご使用できません。<BR>
ご確認の上、ご購入下さい。<BR>



<BR>インドネシア製<BR><BR>
<TABLE border="1" width="400" cellpadding="5" cellspacing="0"><TR><TD>【ご注意】<BR>
・綿素材の性質上、お洗濯の際に毛落ちしますので、洗濯ネットをご使用ください。<BR>
・洗濯機の弱回転で丸洗いをしたあと、脱水機にかけ、形を整えてから陰干ししてください。<BR>
・製品が縮む可能性がありますので、乾燥機は使用しないでください。<BR>
・洗濯時に多少色落ちしますので、他の衣類とは別に洗濯してください。<BR>
・塩素系漂白剤は使用しないでください。<BR>
・ドラム式洗濯機は機種により使用できません。<BR>
・こちらの商品は衛生上、商品タグを外された場合は、ご返品をお受けする事ができません。商品内容（サイズ等）を必ずご確認の上、ご注文ください

