花瓶のように造花を入れて飾ることが出来るトイレブラシ＆ケースです。

トイレブラシの柄の部分には造花などを飾れるように穴が開いているので、気分で造花などをかえて楽しむこともできます。

トイレブラシの柄は、握りやすい少し太めの柄にすることで力の弱い方でも簡単にお掃除できるようになっています。

こちらのトイレブラシはデザインだけでなくワンタッチで取り出せて使い勝手も良くブラシの構造はトイレの隅々までお掃除できるようなデザインになっています。


